import './css/reset.css';
import './css/App.css';

import { useState } from 'react';
import data from "./js/data.js";
import { Routes, Route, Link } from "react-router-dom";


function App() {
  let [shoes] = useState(data);
  return (
    <div className="App">
      <Header/>
      <Routes>
        <Route path="/" element={<h1>메인페이지</h1>}/>
        <Route path="/detail" element={<h1>상품 상세페이지</h1>}/>
        <Route />
      </Routes>
      <section className="product">
        <div className="product-wrap">
          {
            shoes.map((value, index) => {
              return <List key={index} value={value}/>
            })
          }
        </div>
      </section>
    </div>
  );
}

function List(props) {
  return(
    <div className="list">
      <h1 className={`title`}>{props.value.title}</h1>
      <p className="content">{props.value.content}</p>
      <p className="price">{props.value.price}₩</p>
    </div>
  )
}

function Header(props) {
  return(
    <header>
      <ul className="header-wrap">
        <li><a href="/"><p>메인으로 이동</p></a></li>
      </ul>
    </header>
  )
}

export default App;
